import React from 'react'
import Shooting from '../assets/shootingSports.png'
import cardDog from '../assets/cardDog.jpg'

const SeenOn = () => {
    return(
        <div>
            <img src="https://www.paypalobjects.com/webstatic/mktg/logo/pp_cc_mark_111x69.jpg" alt='paypal' />
            <img src={Shooting} alt='shooting sports ish' />
            <img src={cardDog} alt='carddogs' />
        </div>

    )
}

export default SeenOn
